import React from 'react';
import { Button, Grid, Toolbar, Divider } from '@material-ui/core';
import {withStyles,} from '@material-ui/core/styles';
import InstagramIcon from '@material-ui/icons/Instagram';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import IconButton from '@material-ui/core/IconButton';
import './Header.css';

const ColorButton = withStyles((theme) => ({
  root: {
    color: "white",
    background: "black",
    '&:hover': {
      backgroundColor: "black",
    },
    margin: "10px"
  },
}))(Button);

export default function Header() {
    return (
      <Grid container alignItems="center" justify="center" alignContent="center" style={{background: "#DCDCDC"}}>
        <Grid item xs={12} sm={9} style={{textAlign: "left", display: "flex", alignItems: "center", margin: "10px"}}>
            <img src="/images/MathLaw.PNG"></img>
            <div>
              <IconButton>
                <InstagramIcon color="secondary" variant="link" component="span"/>
              </IconButton>
              <IconButton>    
                <LinkedInIcon color="primary" variant="link" component="span"/>
              </IconButton>
            </div>
        </Grid>
        <Grid item xs={12} sm={2} style={{textAlign: "center"}}>
          <ColorButton>Sign Up</ColorButton>
          <ColorButton>Log In</ColorButton>
        </Grid>
      </Grid>

    );
}
